/**
 * @param {number[]} nums
 * @param {number} limit
 * @return {number[]}
 */
var lexicographicallySmallestArray = function(nums, limit) {
    for (let i = 0; i < nums.length; ++i) {
        for (let j = i + 1; j < nums.length; ++j) {
            if (Math.abs(nums[i] - nums[j]) <= limit) {
                let minIndex = i;
                for (let k = i + 1; k <= j; ++k) {
                    if (nums[k] < nums[minIndex]) {
                        minIndex = k;
                    }
                }
                if (minIndex !== i) {
                    let temp = nums[minIndex];
                    for (let k = minIndex; k > i; --k) {
                        nums[k] = nums[k - 1];
                    }
                    nums[i] = temp;
                }
            }
        }
    }
    return nums;
};
